import http from '../../utils/http';
let app = getApp();
let bgImg = 'data:image/jpg;base64,';
let ecompId = 0;
Page({
  data: {
    companyData:{},
    hotJobs:{},
    isJob:false
  },
  changeType:function(e){
    let type = e.target.dataset.type;
    if(type=='jobs'){
      this.setData({
        isJob:true
      });
    }else{
      this.setData({
        isJob:false
      });
    }
  },
  page:1,
  fetchList:function(page){
    let that = this;
    // 热招职位
    http.request({
      url: '/a/t/job/ecomp-oper-job-page.json',
      method: 'POST',
      data: {
        user_id:ecompId,
        start:0,
        size:10*page
      },
      dataType: 'json',
      success: ({data}) => {
        if(data.flag === 1) {
          console.log(data.data);
          that.setData({
            'hotJobs':data.data
          });
        } else {
          wx.showToast({
            title: data.msg || '网络错误',
            duration: 2000
          });
        }
      },
    });
  },
  onReachBottom: function() {
    if(this.data.hotJobs.hasNext) {
      this.fetchList(++this.page);
    }
  },
  onLoad: function (options) {
    let that = this;
    ecompId = options.ecompId-0;
    app.onLogin(() => {
      http.request({
        url: '/a/t/ecomp/detail.json',
        method: 'POST',
        data: {
          ecompId:ecompId
        },
        dataType: 'json',
        success: ({data}) => {
          if(data.flag === 1) {
            console.log(data.data);
            that.setData({
              'companyData':data.data
            });
            if(!data.data.bgImg){
              that.setData({
                'companyData.bgImg':bgImg
              });
            }
          } else {
            wx.showToast({
              title: data.msg || '网络错误',
              duration: 2000
            });
          }
        },
      });
      that.fetchList(that.page);
    });
  }
});
